import s from "./MyPosts.module.css";
import Post from './Post/Post'
const MyPosts = () => {
    return (
        <div>
            <button className={s.button}>Add post</button>
            <ul>
                <Post message = 'Hi, Artem!'/>
                <Post message = 'Hi, Anna!'/>
                <Post message = 'Hi, Govno!'/>
            </ul>
        </div>
    )
}

export default MyPosts;
